import React from "react";

function Cards() {
  return (
    <div className="cards">
      <h1></h1>
      <div className="cards__container">
        <div className="cards__wrapper">
          <ul className="cards__items"></ul>
        </div>
      </div>
    </div>
  );
}

export default Cards;
